  \"2013-03-26T00:00:26.062891\",\n\t\"name\": \"digital-elevation-models-dem-new-york-state\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A Digital Elevation Model (DEM) contains
  a series of elevations ordered from south to north with the order of the columns
  from west to east. The DEM is formatted as one ASCII header record (A-record), followed
  by a series of profile records (B-records) each of which include a short B-record
  header followed by a series of ASCII integer elevations per each profile. The last
  physical record of the DEM is an accuracy record (C-record). The 7.5-minute DEM
  (10- by 10-m data spacing, elevations in decimeters) is cast on the Universal Transverse
  Mercator (UTM) projection (the quads UTM zone can be found in the header record
  (Record A)) in the North American Datum of 1927. It provides coverage in 7.5- by
  7.5-minute blocks. Each product provides the same coverage as a standard USGS 7.5-minute
  quadrangle, but overedges are published as separate DEM files. Coverage is available
  for all quads completely contained within New York State, plus some additional ones
  falling along the borders and containing significant area of the State's land.\",\n\t\"license_title\":
